import {GlobalStyleSheet} from '../../../global-styles/styleSheet';

const primry_color = GlobalStyleSheet.primry_color;
const primary_text_color = GlobalStyleSheet.primary_text_color;

const DashboardStyleSheet = {
    background: {
        background: `${primry_color}`,
    },

    // Styles for the dashboard.js
    search_bar: {
        width: '75%',
        flex: '7',
        border: `2px solid ${primry_color}`,
        margin: '2px 2.5px 1px 1.2px',
    },
    search_btn: {
        background: `${primry_color}`,
        flex: '1',
        border: 'none',
        color: 'white',
        width: '20%',
        float: 'right',
        borderRadius: 'none',
    },
    side_drawer_search_bars: {
        background: `${primry_color}`,
        margin: '0px 1px',
        color: 'white',
        width: '17%',
        maxHeight: '40px',
        maxWidth: '40px',
        border: 'none',
        borderRadius: 'none',
    },
    border: {
        border: '1px solid white',
        background: `${primry_color}`,
        color: 'white',
        borderRadius: '4px'
    },
    link_color: {
        color: `${primary_text_color}`,
    },

    tabs_fontawesome: {
        color: `${primary_text_color}`,
        marginRight: '20px',
        width: '10%',
        maxHeight: '22px',
        maxWidth: '22px',
    },
}

export default DashboardStyleSheet;
